import React, { Component, Fragment } from 'react';
import { Col, Container, Row } from 'react-bootstrap';

class FreeConsult extends Component {
    constructor(){
        super();
        this.state = {
            city1: "Select Your Services",
            city2: "Noakhali",
            city3: "Cumilla",
            city4: "Feni",
            show: ""
        }
    }
    onChangeHandler = (event) => {
        var seletedValue =  event.target.value;
        this.setState({show : seletedValue});
    }
    render() {
        return (
            <Fragment>
                <Container>
                    <Row>
                        <form>
                            <Col>
                                <input type="text" placeholder="First Name" /><br/>
                                <input type="text" placeholder="Last Name" /><br/>
                                <select onChange={this.onChangeHandler} value={this.state.show}>
                                    <option>{this.state.city1}</option>
                                    <option>{this.state.city2}</option>
                                    <option>{this.state.city3}</option>
                                    <option>{this.state.city4}</option>
                                </select><br/>
                                <input type="text" placeholder="Phone" />
                            </Col>
                            <Col>
                                <input type="date" placeholder="Date" /><br/>
                                <input type="time" placeholder="Time" /><br/>
                                <input type="text" placeholder="Message" /><br/>
                                <button>Appointment</button><br/>
                            </Col>
                        </form>
                    </Row>
                </Container>
            </Fragment>
        );
    }
}

export default FreeConsult;
